(77, 1, '2015-04-08 15:33:27', '2015-04-08 15:33:27', '<div class="content">\r\n<ul>\r\n	<li>Deepen your gaming experience with <a href="http://www.amazon.com/dp/B004RMK5QG/ref=PS4PSPlus" target="_blank">PlayStation Plus</a> and <a href="http://www.amazon.com/dp/B00GAC1D2G/ref=PS4GC" target="_blank">PlayStation Gift Cards</a>.</li>\r\n	<li>PlayStation 4 redefines rich and immersive gameplay with powerful graphics and speed, intelligent personalization, deeply integrated social capabilities, and innovative second-screen features</li>\r\n	<li>Background downloading and updating capability also allows you to immediately play digital titles as they download, or update the system when the hardware is powered off.</li>\r\n	<li>PlayStation 4 lets you instantly share images and videos of your favorite gameplay moments on Facebook with a single press of the "share" button on the Dualshock 4 controller.</li>\r\n	<li>Broadcast while you play in real-time through Ustream, allowing friends to comment or jump into your game in new ways.</li>\r\n</ul>\r\n</div>\r\n<div id="more-feature-bullets-atf" class="moreContent expanded">\r\n<ul>\r\n	<li>"Suspend mode" eliminates the load time on your saved game and allows you to immediately return to where you left off by pressing the power button.</li>\r\n	<li>PS4 enables the greatest game developers in the world to unlock their creativity and push the boundaries of play through a platform that is tuned specifically to their needs.</li>\r\n	<li>Engage in endless personal challenges between you and your community, and share your epic moments for the world to see.</li>\r\n	<li>Gamers can share their epic triumphs by hitting the "SHARE button" on the controller, scan through the last few minutes of gameplay, tag it and return to the game.</li>\r\n	<li>With PS Vita, gamers will be able to seamlessly play PS4 games on the beautiful 5-inch display over Wi-Fi in a local environment</li>\r\n</ul>\r\n</div>', 'PlayStation 4 Console', '', 'publish', 'open', 'closed', '', 'playstation-4-console', '', '', '2015-04-08 15:33:27', '2015-04-08 15:33:27', '', 0, 'http://amazonparalelo.com/?post_type=product&#038;p=77', 0, 'product', '', 0),
